import React, { Component } from 'react';
import {
    OwpButton,
    OwpSearchDateTimePickerMulti,
    OwpPageCarded,
    OwpSearchHeader,
    OwpSearchSelectField,
    OwpSearchTextField,
    OwpToolbar,
    OwpTreeGrid,
    OwpSearchAutoComplete,
} from 'owp/wrapper';
import * as TGEvent from 'owp/TGEvent';

class Page extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }


    render() {
        return (
            <React.Fragment>
                <OwpPageCarded
                    header={
                        <OwpSearchHeader url="listOwpProdplan">
                            <OwpSearchDateTimePickerMulti
                                name="sm02"
                                initNow={true} // TODO: true 인 경우 현재 시로 init (* default = false)
                                labels={{ start: ' 발생시작일', end: '종료일' }}
                                inputProps={{ start: { style: { width: 140 } }, end: { style: { width: 140 } } }}
                                required={true}
                            />
                            <OwpSearchSelectField
                                className="w-160"
                                id="1"
                                name="1"
                                items={[
                                    { label: '발생위치1', value: 'Y' },
                                    { label: '발생위치2', value: 'N' },
                                ]}
                                useAll={true}
                                label={'발생위치'}
                            />

                            <OwpSearchSelectField
                                className="w-160"
                                id="1"
                                name="1"
                                items={[
                                    { label: '장비명1', value: 'Y' },
                                    { label: '장비명2', value: 'N' },
                                ]}
                                useAll={true}
                                label={'장비명'}
                            />

                            <OwpSearchSelectField
                                className="w-160"
                                id="1"
                                name="1"
                                items={[
                                    { label: '상태1', value: 'Y' },
                                    { label: '상태2', value: 'N' },
                                ]}
                                useAll={true}
                                label={'상태'}
                            />
                            <OwpSearchTextField
                                className="w-160"
                                id={'sm04'}
                                name={'sm04'}
                                label={'내용'}
                                
                            />
                        </OwpSearchHeader>
                    }
                    contentToolbar={
                        <OwpToolbar title="공정일탈관리">
                            {/* 
                            <OwpButton color={'secondary'} variant={'outlined'}>
                            출력
                            </OwpButton> */}
                        </OwpToolbar>
                    }
                    content={
                        <React.Fragment>
                            <OwpTreeGrid
                                id="C0207000"
                                LayoutUrl={'/assets/data/C0207000Def.xml'}
                                DataUrl={'/assets/data/C0202000Data.xml'}
                            />
                        </React.Fragment>
                    }
                    innerScroll
                />
            </React.Fragment>
        );
    }
}

export default Page;
